class DeepClone{static clone(e){if(this._validateInputForDeepClone(e))return this._validateArray(e)?this._deepCloneArray(e):this._deepCloneObject(e);console.warn(`Deep Clone input invalid : ${e} is not of type object`)}static _deepCloneObject(e){const t={};return Object.keys(e).forEach(a=>{const r=e[a],i=this._copyValue(r);t[a]=i}),t}static _deepCloneArray(e){const t=[];return e.forEach(e=>{const a=this._copyValue(e,!0);t.push(a)}),t}static _copyValue(e){return this._validateArray(e)?this._deepCloneArray(e):this._validateObject(e)?this._deepCloneObject(e):e}static _validateInputForDeepClone(e){return this._validateObject(e)||this._validateArray(e)}static _validateObject(e){return"object"==typeof e}static _validateArray(e){return Array.isArray(e)}}
